precision lowp float;

uniform float amplitude;
uniform vec3 startColor;
uniform vec3 endColor;
uniform float transparency;

varying vec3 vNormal;
varying vec4 vTest;
varying float vSize;


void main() {
vec3 light = vec3(0.5,0.2,1.0);
light = normalize(light);

float vProd = max(0.0, dot(vNormal, light));

vec3 modColor = vec3(0.0, 0.0, 0.0);
modColor.x = ((endColor.x - startColor.x) * (vSize*2.4689849833615334)) + startColor.x;
modColor.y = ((endColor.y - startColor.y) * (vSize*2.4689849833615334)) + startColor.y;
modColor.z = ((endColor.z - startColor.z) * (vSize*2.4689849833615334)) + startColor.z;
gl_FragColor = vec4(modColor, transparency);

}

